import React, {Component} from 'react';
import './Navigation';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {collapsed: true};
    }
    render() {
        return (
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <a className="navbar-brand" href="#">Navbar</a>
                <button className="navbar-toggler" type="button" onClick={()=>this.setState({collapsed: !this.state.collapsed})}>
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className={this.state.collapsed?'navbar-collapse collapse':'navbar-collapse'} id="navbar"> 
                    <ul className="navbar-nav mr-auto my-2 my-lg-0 navbar-nav-scroll">
                    <li className="nav-item active">
                        <a className="nav-link" href="#">Landing <span className="sr-only">(current)</span></a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">Search</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">Order</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">About</a>
                    </li>
                    </ul>
                    <form className="d-flex">
                    <input className="form-control mr-2 bg-dark text-light" type="search" placeholder="Search"/>
                    <button className="btn btn-outline-primary" type="submit">Search</button>
                    </form>
                </div>
            </nav>
        );
    }
}

export default Navigation;
